                                            <p>मण्डनदेउपुर नगरपालिका वडा नं. 7, कुन्तावेशीमा नेपाल विद्युत प्राधिकरण पाँचखाल वितरण केन्द्रको हिँगुवापाटी नो-लाईट तथा आय काउन्टर शाखा उद्&zwj;घाटन कार्यक्रमका केही झलकहरु। हिँगुवापाटी नो-लाईट तथा आय काउन्टर शाखा सञ्&zwj;चालन भए संगै अब देखि विद्युत महसुल तिर्न पाँचखाल सम्म पुगिराख्&zwj;नु पर्ने समस्याको समाधान भएको छ। विद्युत महशुल आफ्नै नगरपालिकामा तिर्न सकिने सुविधा २०७८।०४।०८ गते देखि शुरुवात भएको छ।</p>
